import * as React from "react";

export default function SignUpMFA() {
  // Make a GET request
  const postUrl = "https://google-authenticator.p.rapidapi.com/new_v2/";

  fetch(postUrl, {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "fe429437acmsha7ed221cdbef09cp18fe87jsne9ad06748138",
      "X-RapidAPI-Host": "google-authenticator.p.rapidapi.com",
    },
  })
    .then((response) => {
      response.json();
    })
    .then((data) => {
      console.log(data);
    })
    .catch((error) => console.log(error));

  return <h1>Scan the barcode from Google Authenticator</h1>;
}
